import React from 'react';
import { IHomeProps } from '../types/types';

const Home = (props: IHomeProps) => {

    return (
        <>
            <p>Dies ist ein Projekt im Rahmen einer Masterarbeit des Geographischen Instituts der Ruhr-Universität Bochum.</p>
            <p>Dabei sollen freiwillig und anonymisiert Daten von an Corona erkrankten Personen im Stadtgebiet Kölns erhoben werden.</p>
            <p>Ziel ist es darüber Erkenntnisse zu erlangen wie Corona-Fälle kleinräumig auf Stadtteilebene innerhalb Kölns verteilt sind und inwiefern freiwillig erhobene Daten einen Beitrag dazu leisten können.</p>
            <p>Über die untenstehenden Buttons findest du eine Anleitung zur Datenerhebung und Infos zum Datenschutz.</p>
        </>
    );
};

export default Home;
